import Nav from './Nav';
import logo from '../images/little-palm-logo.png';

function Header() {
  return (
    <header className='App'>
      <img src={logo} alt="Little Lemon Logo" className='App-logo' />
      <Nav/>
    </header>
  );
}

export default Header;
